    let layoutFlowStyle = {};

    const style_elCard_outer = {
        backgroundColor: 'white',
        boxShadow: '0.0px 2.3px 18px rgba(0, 0, 0, 0.1600)',
     };

    return (
      <div className="Comp1" style={baseStyle}>
        <div className="layoutFlow">
          <div className='elCard' style={style_elCard_outer}>
            <div className='cardBg' />

          </div>

          <div className='hasNestedComps elComp'>
            <div className=''>
              <Comp2 ref={(el)=> this._elComp = el} appActions={this.props.appActions} deviceInfo={this.props.deviceInfo} locStrings={this.props.locStrings} />
            </div>

          </div>

        </div>
      </div>
    )
  }


}
